import { motion } from "framer-motion";
function Projects() {
  return (
    <motion.section
      initial={{ opacity: 0, y: 30 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
    >
      <h2 className="text-xl font-semibold mb-4">Projects</h2>
      <div className="grid gap-4 sm:grid-cols-2">
        <div className="p-4 bg-gray-50 rounded-lg shadow hover:shadow-md transition">
          <h3 className="text-lg font-bold mb-1">Portfolio Website</h3>
          <p className="text-sm text-gray-600 mb-2">
            A personal portfolio built with React and Tailwind.
          </p>
          <span className="text-xs text-gray-400">2024.08</span>
        </div>
        <div className="p-4 bg-gray-50 rounded-lg shadow hover:shadow-md transition">
          <h3 className="text-lg font-bold mb-1">Task Manager App</h3>
          <p className="text-sm text-gray-600 mb-2">
            Todo App with drag and drop, built in React.
          </p>
          <span className="text-xs text-gray-400">2024.05</span>
        </div>
      </div>
    </motion.section>
  );
}

export default Projects;
